import React from 'react';
import PropTypes from 'prop-types';

const ImagePort = (props) => (

  <div className={` ${props.isScalable ? "compareImages" : ""}`}>
  <img  
  src={props.src}
  width = {props.width}
  height = {props.height}  
  />
  </div>
);

ImagePort.defaultProps = {
  width: '100%',
  height: '100%',
  isScalable : false
};

export default ImagePort;
